USE zonas_verdes;

DROP TABLE IF EXISTS `espacio_publico`;

CREATE TABLE `espacio_publico` (
`ID_Unico` VARCHAR(255),
  `Nomnbre_del_Espacio` VARCHAR(255),
  `Direccion_del_Espacio` VARCHAR(255),
  `Tipo_de_Espacio` VARCHAR(255),
  `Nombre_de_Barrio` VARCHAR(255),
  `Nombre_de_comuna` VARCHAR(255),
  `Area_total_m2` FLOAT,
  `Id_del_espacio` FLOAT,
  `Dominio_del_espacio` VARCHAR(255),
  `Estado_del_Espacio` VARCHAR(255),
  `Id_del_espacio_geo` FLOAT,
  `Longitud` VARCHAR(255),
  `Latititud` VARCHAR(255),
  `Codigo_de_Barrio` VARCHAR(255),
  `Codigo_comuna` FLOAT,
  `Unnamed:_15` FLOAT,
  `Unnamed:_16` FLOAT,
  `Unnamed:_17` FLOAT,
  `Unnamed:_18` FLOAT,
  `Unnamed:_19` FLOAT,
  `Unnamed:_20` FLOAT,
  `Unnamed:_21` FLOAT
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;

